import React from 'react';
import Link from 'next/link';
import Nav from './Nav';

const Header = () => {
  return(
    <div>
      <div className="bar">
        <h1>
         <Link href="/">
          <a>Linxify</a>
        </Link>
        </h1>
        <Nav />
      </div>
      <div className="sub-bar">
        <p>Search</p>
      </div>
   </div>
  );
};

export default Header;
